package p13.textbook.exericses.ex03;

public class Container<T, K> {
	private K Key;
	private T Value;
	public void set(T Value, K Key) {
		// TODO Auto-generated method stub
		this.Key = Key;
		this.Value = Value;
	}
	public K getKey() {
		// TODO Auto-generated method stub
		return Key;
	}
	public T getValue() {
		// TODO Auto-generated method stub
		return Value;
	}
	
	
	
	
	
	
	
}
